<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br><b>Git </b>est un système de contrôle de version distribué qui suit les changements dans n'importe quel ensemble de fichiers informatiques, généralement utilisé pour coordonner le travail entre les programmeurs développant en collaboration le code source pendant le développement du logiciel. Ses objectifs incluent la vitesse, l'intégrité des données et la prise en charge des flux de travail distribués et non linéaires (des milliers de branches parallèles s'exécutant sur différents ordinateurs). Comme avec la plupart des autres systèmes de contrôle de version distribués, et contrairement à la plupart des systèmes client-serveur, chaque répertoire Git sur chaque ordinateur est un référentiel à part entière avec un historique complet et des capacités complètes de suivi des versions, indépendamment de l'accès au réseau ou d'un serveur central. Git est un logiciel gratuit et open source partagé sous la licence GPL-2.0 uniquement.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
