<h1 class="Section4">
<a class="Section5" href="#" id="branches">Branches</a>
</h1>
<div class="Section6"><br>La commande (branch) permet de lister les branches du dépôt local.<br><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">git branch</pre><br><pre class="GCode1 Code1 AceCode" data-mode="txt" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">* main</pre><br>Ce qu'il faut savoir:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">L'étoile (*) indique la branche courante local</div>
</div><br>La commande (branch) permet de lister les branches du dépôt distant.&nbsp;<br><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">git branch -r</pre><br><pre class="GCode1 Code1 AceCode" data-mode="txt" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">  origin/1.0
  origin/2.0
  origin/2.1
  origin/HEAD -&gt; origin/main
  origin/main</pre><br>Ce qu'il faut savoir:<br><br><div class="GBullet1 Bullet1">
<i class="Bullet2 fa fa-check-square-o"></i>
<div class="Bullet3">L'entête (HEAD) indique la branche courante distant</div>
</div><br>La commande (branch) permet de lister à la fois les branches du dépôt local et distant.&nbsp;&nbsp;<br><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">git branch -a</pre><br><pre class="GCode1 Code1 AceCode" data-mode="txt" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">* main
  remotes/origin/1.0
  remotes/origin/2.0
  remotes/origin/2.1
  remotes/origin/HEAD -&gt; origin/main
  remotes/origin/main</pre><br>La commande (checkout) permet changer de branche.<br><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">git checkout 1.0</pre><br><pre class="GCode1 Code1 AceCode" data-mode="txt" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">Branch '1.0' set up to track remote branch '1.0' from 'origin'.
Switched to a new branch '1.0'</pre><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">git branch</pre><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">* 1.0
  main</pre><br></div>
